import React, { Component } from "react";

class TeamMemberList extends Component {
  state = {};
  render() {
    const style = {
      paddingTop: "10px",
      paddingBottom: "10px",
      marginTop: "10px",
      marginBottom: "10px"
    };
    return <input type="text" placeholder="Enter name" style={style} />;
  }
}

export default TeamMemberList;
